// https://www.youtube.com/watch?v=GGkBwpxV7AI
import React from 'react';
import styled from 'styled-components'

const Ul = styled.ul`
list-style: none;
`

const NavBar = () => {
    return (
        <div>
         <Ul>
             <li>Home</li>
             <li>Skills</li>
             <li>Background</li>
             <li>Contact</li>
         </Ul>
        </div>
    )
}

export default NavBar
